from django.utils.encoding import force_text


class BlockedEmailsProvider(object):

    @staticmethod
    def is_valid(value) -> bool:
        value = force_text(value.lower())

        if "@" in value:
            domain = value.split('@')[1]
            emails = BlockedEmailsProvider.BLOCKED_EMAIL_DOMAINS
            chunks = (emails[i:i + 20] for i in range(0, len(emails), 20))

            for email_group in chunks:
                if domain in email_group:
                    return False
        else:
            return False
        return True

